import React from "react";

const SharedModal = ({ type, data }) => {
  return type === "video" ? (
    <div>
      <img className="h-[20rem] rounded-3xl mx-auto" src={data} alt="" />
    </div>
  ) : (
    <video className="rounded-3xl h-[80%] mx-auto" src={data} controls></video>
  );
};

export default SharedModal;
